import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import ListOfProjects from "./ListOfProjects";
import {Films} from "./Films"
class Nav extends Component { 
    render() { 

        return ( 
          <div className="Nav">
              <div className="header">
                <div>
                  <h2>Фильмы</h2>
                </div>
                <div id="filmName">
                  {Films.map(film => (<li key={film.id}>{film.id}.{film.name}, Рейтинг фильма: <span style={{color: "#aeb002"}}>{film.rayting}</span></li>))}
                </div>  
            <div><h2>Афиша фильмов</h2></div>
               </div>
            <div className="films">
                {Films.map(film => 
                   <ListOfProjects 
                   key={film.id}
                   photo={film.photo}
                   rayt={film.rayting}
                   name={film.name}
                   opisan={film.opisan}
                   id={film.id}
                  />
                  )}   

              {/* {Films.map((e,i) =>
                  <ListOfProjects 
                  photo={e.photo}
                  rayt={e.rayting}
                  name={e.name}
                  opisan={e.opisan}
                  id={e.id}
                  key={i}
                  />
              )} */}
            </div>

          </div>
        )  
    }
}
ReactDOM.render(
  <div>
    <Nav />
  </div>,
document.getElementById("root")
)
